(132, 'JTDBT123520243495', 2002, 3650, 'Echo', 'TOYOTA', 448, 'NCP12L', '', 4, 4000, 'This sky blue Toyota Echo has an excellent Carfax history with no accidents and current emissions. It has recently been given a brand new A/C compressor along with a tune-up. All the features are in good working order.  I can be reached at (770) 262-9880. Carfax available upon request. Se habla Espanol   About Me: My name is Steven Lang. For over 18 years I have maintained a perfect 100% positive feedback rating on Ebay because I go out of my way to be truthful and direct.  If you Google \'long-term quality\', you\'ll see a long-term quality study on used cars that I co-developed which now outranks Consumer Reports and has nearly three million vehicles inspected by professional mechanics.  www.dashboard-light.com   If you\'re looking for a well maintained Toyota with an automatic transmission feel free to reach me at (770) 262-9880 . All the best.   Browse a few dozen stories I have written for Car and Driver and elsewhere that cover all things automotive.  https://www.google.com/search?q=steven+lang+car+and+driver&oq=steven+lang+car+and+driver&aqs=chrome..69i57j35i39j69i59.4711j0j7&sourceid=chrome&ie=UTF-8    View my current Craigslist inventory.  https://atlanta.craigslist.org/d/for-sale/search/sss?query=steven%20lang%20craigslist&sort=rel', 1, 4, 'Gasoline', 155000, '4x2', '', 'Sedan/Saloon', 'blue', 4, 0, 'PASSENGER CAR'),
