(217, 'JTDZN3EU6D3195340', 2013, 13822, 'Prius V', 'TOYOTA', 448, 'ZVW41L', '', 4, 8900, 'This 2013 Toyota Prius V has been maintained at Milton Martin Toyota and comes with a healthy list of records. It also has an excellent Carfax history.  The cloth is in great shape and it does come with a rear view camera as well.  I can be reached at (770) 262-9880. Carfax available upon request. Se habla Espanol   About Me: My name is Steven Lang. For 18 years I have maintained a perfect 100% positive feedback rating on Ebay because I go out of my way to be truthful and direct.  If you\'re looking for a well optioned Prius V that has an excellent maintenance history, feel free to reach me at (770) 262-9880. All the best.   Visit my Facebook car buying site with over 2700 followers.  https://www.facebook.com/48-Hours-And-A-Used-Car-327864380887174   Browse a few dozen stories I have written for Car and Driver and elsewhere that cover all things automotive.  https://www.google.com/search?q=steven+lang+car+and+driver&oq=steven+lang+car+and+driver&aqs=chrome..69i57j35i39j69i59.4711j0j7&sourceid=chrome&ie=UTF-8    View my current Craigslist inventory.  https://atlanta.craigslist.org/d/for-sale/search/sss?query=steven%20lang%20craigslist&sort=rel', 1, 4, 'Gasoline', 142900, '4x2', '', 'Wagon', 'blue', 5, 0, 'PASSENGER CAR'),
