(223, '4T1BD1FK4DU076083', 2013, 2469, 'Camry', 'TOYOTA', 448, 'ASV50L/GSV50L/AVV50L', 'Hybrid', 4, 10800, 'This is my personal vehicle and I LOVE IT, but I have no choice but to sell it, because my employer requires a newer year model for mileage reimbursement.  Absolutely nothing wrong with it.  It has been a perfect car.  I bought it with 32k miles on it.  It is loaded with both factory keys and has all the luxuries you need with push button start, heated leather seats, back up camera, audio control on steering wheel, factory mats, and so much more.  My price is firm but fair and I have the title in hand.  Please do not hesitate to call or text me with any questions.  Good luck on your search for a Camry... you may want to check this one out.', 1, 4, 'Gasoline', 147000, '4x2', '', 'Sedan/Saloon', 'grey', 4, 0, 'PASSENGER CAR'),
