(522, 'NM0GS9F23K1426362', 2019, 1811, 'Transit Connect', 'FORD', 460, 'XLT', '', 4, 41000, '2019 Ford Transit Connect Mini-T Campervan  Mileage: 29,288  VIN: NM0GS9F23K1426362  Looking for an RV and car but do not want the expense of both? Explore the features and benefits of a Mini T Campervan. Enjoy the comforts and safety of your own bed while traveling.  Great gas mileage, fits in a standard garage, RV gets 24-29 MPG!  This 2019 Ford Transit Connect Mini-T Campervan is just: 80\" high (with roof features) and 189.7\" (15.8 ft) long  Campervan questions? Delivery or RV financing questions? Call today 651-285-7089 or 507-382-9446  Great gas mileage, fits in a standard garage, RV gets 24-29 MPG  Full details on dealer website at www.dlm-distribution.com  2019 Mini-T Transit Connect Camper Van  “Garageable CamperVan”  This Mini-T Campervan has great RV features: Awning, solar, fully automatic low-profile RV TV antenna, 10 speed thermostatically controlled reversible roof fan, TV/DVD combo, microwave, sink, 24 quart highly efficient compressor refrigerator that holds the equivalent of 27, 12 ounce cans, dual house batteries, 2000W maximum inverter for “off grid” 120V needs, and a 120V shore power outlet, limo-tinted windows (provide privacy), front privacy curtain, Weathertech sunshades, Weathertech floormats, side window screens for bug control and added ventilation, vinyl flooring, underbed storage containers, portable cook stove a shore power cord and folding portable toilet stored under the bed.  Safety features include a large rear-view camera, airbags, tire pressure monitoring system, rain sensing wipers, pre-collision assist with automatic emergency braking and rear sensing system. This Camper Van also included convenience features including 2 smart USB ports, wireless phone charging pad, Sync 3, voice activated Navigation and Ford Pass.  This 2019 Ford Transit Connect Mini-T Campervan provides both safety features and the Class B Campervan conversion comforts you will enjoy. While providing your with a fuel efficient and easy to drive and park RV or daily driver.  Campervan questions? Delivery or RV financing questions? Call today 651-285-7089 or 507-382-9446  Little Camper Van with BIG off-grid capabilites! Run Microwave off grid=YES, Run Hair dryer, curling iron etc off grid=YES, Run CPAP off grid=YES!  Full details, photos and video on dealer website at www.dlm-distribution.com _____________________________________________________________________ DLM-Distribution is Minnesota Camper Van Manufacture and licensed dealer. Serving customers nationwide ~ We make nationwide sales and logistics simple! -----------------------------------------------------------------------------------------------------------------   Fly in / Drive in / Trade / Delivery options available.  WHY IS A SMALL RV OR CAMPERVAN BETTER THAN A LARGE RV?  Small Motor Home / Class B advantages why look closely at the Transit or Connect Campervans?:  1. Better fuel economy  2. Camper vans are easier to drive than a big motorhome  3. Can go through any car wash- easy to keep clean inside and outside clean- smaller is better!  4. Can access smaller roads and dirt roads leading to \"out of the way\" dispersed camping opportunities  5. Can take a nap, get some sleep rest wherever parking is allowed.  6. With a small RV you can and drive your vehicle to explore the area and your RV home and food is always with you so you can save on restaurant meals. With a larger RV you would need to leave it behind and take a second- pulled behind vehicle to enable parking and exploring  7. A camper van will go anywhere a car can go- garage, parking garage, small roads, parking in busy cities or high brush areas with low trees.  8. If, while exploring, you find a great overnight spot, you can stay without having to backtrack to get your RV.  9. Storage is enough for most people, with less storage space you tend to bring less \"stuff\" you will likely not use and be less tempted to buy too much in route. Extra stuff along the way on an extended trip gets mailed home enabling you to stay on the road without clutter  10. Can be used as a primary or secondary vehicle when not traveling. Great for tailgating.  11. This small Camper Van RV should hold its value better than a larger RV due to escalating fuel prices, high storage prices and higher insurance costs for the bigger RV motorhomes.  12. You don\'t need a toad (tow vehicle) adding additional expense and set up time when camping and maneuvering around your destination  13. You can park it in your driveway- big plus, no storage fee\'s  14. You will not pull into a parking lot wondering if you will be able to park or turn around  15. More camping opportunities, many camp grounds do not have spots for the larger motorhomes  16. Great for a trip to your friend\'s bon-fire and parties- You always have a place to stay without imposing on their home and space. Beside the big benefit of sleeping in your own bed with your own bedding!  17. Of course you save on hotel fees when traveling but with a Transit Connect Camper van you can pull over, sleep and not have to unload to go into a hotel, pack back up and load vehicle again each night. Setting the bed up takes seconds!  18. Using a camper van as a primary vehicle is a wonderful option- less insurance, less cost maintaining multiple vehicles and you can be spontaneous- your gear is with you, spend the night, make a meal, go for that extended hike. Take advantage of your time without having to return home to resupply for your next adventure.  19. A Large Motor home often does not get used many days out of the year. Think about \"cost per use when making your RV purchase decision!  Large home= monthly payment + storage when not in use, + 8 +/- MPG fuel economy, + insurance, + depreciation, + cleaning and maintenance costs, plus higher camp ground fees- full hookups) Consider a $100,000 big Motorhome RV financed with all associated costs that is used 3 weeks per year on average. You will find this RV costing over $1050 per use!   Small Motor home= Higher use, Reduced monthly payment, high MPG fuel economy, less insurance cost (insures like a car), will likely depreciate less, easier to sell if you choose to sell later, clean at home or at gas station car wash, lower camp fees.   NOTE: You must run your own numbers when considering the examples above. 1) Financing 2) how often you use your RV 3) style of camping and other variables will all make a difference in your cost per use.    DLM-Distribution is a Minnesota Manufacture and licensed dealer serving the camping and traveling community nationwide.  Nationwide Camper Van shipping available!  Full details on dealer website at www.dlm-distribution.com  Campervan questions? Delivery or RV financing questions? Call DLM-Campervans today 651-285-7089 or 507-382-9446', 1, 4, 'Gasoline', 29288, '', '', 'Van', 'white', 0, 6, 'TRUCK '),
