(580, 'JN8AZ2NE6D9060199', 2013, 2326, 'QX56', 'INFINITI', 480, '', '', 5, 19500, 'Important to Note:  Ask around - Used cars at retail dealerships are selling at a premium and this particular infinity SUV ranges in retail price, from $21,500-$23,500, but this Private owner, is selling their Infinity SUV for $19,500.  Our family purchased this SUV less than a year ago at the Royal Automotive (Volvo, GMC and Volkswagen) Dealership, at the corner of Hwy. 31 and I-65 (Vestavia, AL)  2013 Infinity QX 56, 4WD Immaculate Condition - Inside and Out Loaded - Pure Luxury Price: $19,500 Current Miles: 119,895  Without hesitation of thought, this Infiniti QX56, is without doubt, the nicest vehicle our family has ever owned and/or driven, and we purchased this SUV, w the understanding of very limited local driving, but wanted access, to a nice SUV for our family, to take 2-3 vacation trips each year.  Prior to this purchase, this was a one-owner SUV, and since our (less-than-one-year) ownership, we’ve driven approximately 10k miles.   In all candor, and not to come across or sound overly confident in any way, this Seller strongly believes that, the first candidate that is, seriously shopping for a extremely clean, well maintained, high-quality, luxury SUV that, actually takes the time, to see & drive this SUV (will likely purchase it)...  This vehicle has so many features that perspective buyers, should consider referencing the VIN #, to query all of vehicle’s features.   This vehicle is aggressively priced, in relation to what the market reflects, as being priced significantly below (retail).  Owner is motivated, but not desperate, as other spouse is eager to just keep this SUV, and avoid rental SUVs, for future vacation trips.   Due to recent changes at work, owner is now driving, an extra 350-500 miles each month, so Seller is replacing this SUV, ideally w a more practical business Sedan.  Owner needs no assistance w selling this vehicle:  Serious interested parties and prospective Buyers, should shop other similar Infinity QX56 models, if only to see how competitively priced this SUV has been listed.  Prospective Buyer will be hard pressed to find as nice and pristine a 2013 Infinity QX56 as this vehicle is, for sale price.  It can sit beside a new 2020 QX 80 and be difficult to pick out the newest of the two vehicles.  This same vehicle would be listed between $21,500 - $23,500 or more, if sold on a retail car lot!', 1, 0, 'Gasoline', 119895, '4WD/4-Wheel Drive/4x4', '', 'Sport Utility Vehicle (SUV)/Multi-Purpose Vehicle (MPV)', 'grey', 4, 0, 'MULTIPURPOSE PASSENGER VEHICLE (MPV)'),
