(733, '1NXBU40E79Z035670', 2015, 2208, 'Corolla', 'TOYOTA', 448, '', '', 4, 12900, 'This white 2015 Volkswagen Passat SE TDI has been diligently maintained at Volkswagen dealerships with 12 service records in all. This particular year also features the Generation 3 engine which offers more horsepower and torque than any other TDI in a Volkswagen car.  It drives very well, has been garage kept, and has a clean Carfax history. All the features are in perfect working order.  I can be reached at (770) 262-9880. Carfax available upon request. Se habla Espanol   About Me: My name is Steven Lang. For over 18 years I have maintained a perfect 100% positive feedback rating on Ebay because I go out of my way to be truthful and direct.  If you google long-term quality or \'long-term reliability\', you\'ll see a reliability study on used cars I co-developed that now outranks Consumer Reports and J.D. Power for over five years on google.   OR JUST COPY AND PASTE THE SITE BELOW  www.dashboard-light.com  Click on the Passat, scroll down, and you\'ll see a year by year analysis of over 16,000 mechanical inspections of this model. Since the 2012 model year the Passat has earned an average or better than average rating.   If you\'re looking to buy a low-mileage turbodiesel with only 74,000 miles, and features one of the most advanced powertrains in today\'s market, free to reach me at (770) 262-9880. All the best.    View my online dealership (just copy and paste!)  www.facebook.com/48-Hours-And-A-Used-Car-327864380887174/\"     Browse a few stories IF you\'re just a wee bit tired of clicking on endless Craigslist ads... (get a tall cup of coffee!)  www.google.com/search?ei=skbfWtCKE5L9zgLs9LCIDw&q=steven+lang+and+cars&oq=steven+lang+and+cars&gs_l=psy-ab.3..35i39k1.11630.12285.0.12441.4.4.0.0.0.0.97.311.4.4.0....0...1.1.64.psy-ab..0.4.306...0i22i30k1j0i22i10i30k1.0.wzPYGqIfamg\"  View my online dealership (just copy and paste.)  www.facebook.com/48-Hours-And-A-Used-Car-32786438088717