(736, 'JTDJT923675130076', 2007, 2464, 'Yaris', 'TOYOTA', 448, 'NCP91L / NCP93L', '', 4, 5500, 'This sky blue 2007 Toyota Yaris has only been driven approximately 3700 miles a year (51,900 miles) and has been garaged as well.  Seats are in excellent shape with no rips or tears (see pictures). All the features are in good working order. There are some scratches on the passenger side I have taken pictures of up close but other than that this Toyota is in excellent condition.  The Toyota Yaris is also the single highest ranked subcompact when it comes to long-term reliability.  http://dashboard-light.com/vehicles/Toyota_Yaris.html  I can be reached at (770) 262-9880. Carfax available upon request. Se habla Espanol    About Me: My name is Steven Lang. For 18 years I have maintained a perfect 100% positive feedback rating on Ebay because I go out of my way to be truthful and direct.  If you Google \'long-term quality\', you\'ll see a long-term quality study on used cars that I co-developed which now outranks Consumer Reports and has nearly three million vehicles inspected by professional mechanics.  www.dashboard-light.com   If you\'re looking for a Toyota Yaris with a 5-speed manual transmission and low miles, feel free to reach me at (770) 262-9880 . All the best.   Browse a few dozen stories I have written for Car and Driver and elsewhere that cover all things automotive.  https://www.google.com/search?q=steven+lang+car+and+driver&oq=steven+lang+car+and+driver&aqs=chrome..69i57j35i39j69i59.4711j0j7&sourceid=chrome&ie=UTF-8    View my current Craigslist inventory.  https://atlanta.craigslist.org/d/for-sale/search/sss?query=steven%20lang%20craigslist&sort=rel', 1, 4, 'Gasoline', 51000, '4x2', '', 'Hatchback/Liftback/Notchback', 'blue', 2, 0, 'PASSENGER CAR'),
(739, '3VWDX7AJ0DM207663', 2013, 3137, 'Jetta', 'VOLKSWAGEN', 482, 'Comfortline/Sportline', '', 4, 6500, 'This 2013 Vokswagen Jetta SE has been an exceptionally well kept vehicle. It has just been given a new set of tires and comes with an upgraded Bluetooth system along with A Fender premium audio system, a 5-inch touch screen, HD Radio, V-Tex leatherette upholstery, heated front seats, and a leather-wrapped steering wheel.  The seats are in great shape and all the features are in good working order. I can be reached at (770) 262-9880. Carfax available upon request. Se habla Espanol    About Me: My name is Steven Lang. For over 18 years I have maintained a perfect 100% positive feedback rating on Ebay because I go out of my way to be truthful and direct. If you Google my name and \'cars\' you will find plenty about my daily work.  If you\'re looking for a late model sports sedan with low miles feel free to reach me at (770) 262-9880 . All the best.   View my current Craigslist inventory.  https://atlanta.craigslist.org/search/sss?query=steven+lang&sort=rel   View my Facebook page for 2015 and newer vehicles  https://www.facebook.com/48-Hours-And-A-Used-Car-327864380887174/    Browse a few stories I have written for Car and Driver that cover all things automotive.  https://www.google.com/search?q=steven+lang+car+and+driver&oq=steven+lang+car+and+driver&aqs=chrome..69i57j35i39j69i59.4711j0j7&sourceid=chrome&ie=UTF-8', 1, 5, 'Gasoline', 135000, '', 'Automatic', 'Sedan/Saloon', 'white', 4, 0, 'PASSENGER CAR'),
